/*Table structure for table `yj_admin_sys_log_tbl` */

DROP TABLE IF EXISTS `yj_admin_sys_log_tbl`;

CREATE TABLE `yj_admin_sys_log_tbl` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `admin_id` int(10) unsigned DEFAULT '0' COMMENT '操作者',
  `type_id` int(10) unsigned DEFAULT '0' COMMENT '类型',
  `level` int(10) unsigned NOT NULL DEFAULT '100' COMMENT '日志等级，100 debug，200 info，250 notice，300 warning，400 error， 500 critical， 550 alert， 600 emergency',
  `action_type` int(2) unsigned DEFAULT '1' COMMENT '操作类型1:审核订单 2.商品 3.商城商家 4.商城订单',
  `action_id` bigint(15) unsigned DEFAULT '0' COMMENT '操作ID',
  `note` text CHARACTER SET gbk COMMENT '备注',
  `create_time` int(10) DEFAULT NULL COMMENT '操作时间',
  `details` blob COMMENT '具体内容',
  PRIMARY KEY (`id`),
  KEY `admin_id` (`admin_id`),
  KEY `type_id` (`action_type`,`action_id`,`type_id`),
  KEY `action_id` (`action_id`)
