/*Table structure for table `yj_admin_user_tbl` */

DROP TABLE IF EXISTS `yj_admin_user_tbl`;

CREATE TABLE `yj_admin_user_tbl` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(255) NOT NULL COMMENT '用户名',
  `password` varchar(64) NOT NULL COMMENT '密码',
  `department` varchar(255) NOT NULL DEFAULT '' COMMENT '所属部门',
  `phone` varchar(20) NOT NULL COMMENT '联系手机',
  `status` tinyint(1) unsigned NOT NULL DEFAULT '1' COMMENT '状态，0 禁用，1 正常',
  `role_id` int(10) unsigned DEFAULT NULL COMMENT '角色ID',
  `role_level` varchar(255) DEFAULT '' COMMENT '角色层级，多级以英文","分割，如：5,12，用于js下拉选择插件',
  `op_user_id` int(10) unsigned NOT NULL COMMENT '操作人ID',
  `create_time` int(10) unsigned NOT NULL COMMENT '添加时间',
  `update_time` int(10) unsigned NOT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`),
  UNIQUE KEY `idx_phone` (`phone`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=42 DEFAULT CHARSET=utf8 COMMENT='管理员表';

