/*Table structure for table `yj_article_statistics_tbl` */

DROP TABLE IF EXISTS `yj_article_statistics_tbl`;

CREATE TABLE `yj_article_statistics_tbl` (
  `article_id` int(10) unsigned NOT NULL COMMENT '文章ID',
  `click_count` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '点击数，即阅读量',
  `comment_count` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '评论数',
  `collect_count` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '收藏数',
  `like_count` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '点赞数',
  `create_time` int(10) unsigned NOT NULL COMMENT '创建时间',
  PRIMARY KEY (`article_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='文章统计表';

/*Data for the table `yj_article_statistics_tbl` */

/*Table structure for table `yj_article_tbl` */

DROP TABLE IF EXISTS `yj_article_tbl`;

CREATE TABLE `yj_article_tbl` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `title` varchar(60) NOT NULL COMMENT '文章标题',
  `type_id` tinyint(1) unsigned NOT NULL DEFAULT '1' COMMENT '文章性质，1 图文，2 图集，3 视频',
  `category_id` int(10) unsigned NOT NULL COMMENT '分类ID',
  `category_path` varchar(120) NOT NULL COMMENT '分类路径，多级分类用“-”连接',
  `cover` varchar(250) DEFAULT NULL COMMENT '封面图路径',
  `jump_type` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '跳转类型',
  `jump_target` varchar(250) DEFAULT NULL COMMENT '跳转目标，指定ID或指定连接',
  `status` tinyint(1) unsigned NOT NULL DEFAULT '1' COMMENT '状态，0 下架，1 上架 2 删除',
  `sort` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '排序值，越大则显示越靠前',
  `essence` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '精华值',
  `description` varchar(1000) DEFAULT NULL COMMENT '文章简介',
  `creator_id` int(10) unsigned NOT NULL COMMENT '创建者ID',
  `create_time` int(10) unsigned NOT NULL COMMENT '创建时间',
  `update_time` int(10) unsigned NOT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`),
  KEY `idx_category_id` (`category_id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=1937451 DEFAULT CHARSET=utf8 COMMENT='文章表';

