/*Table structure for table `yj_auth_rule_tbl` */

DROP TABLE IF EXISTS `yj_auth_rule_tbl`;

CREATE TABLE `yj_auth_rule_tbl` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(30) NOT NULL DEFAULT '' COMMENT '规则名称',
  `url` varchar(250) NOT NULL DEFAULT '' COMMENT '规则连接，需保证唯一',
  `pid` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '父节点ID',
  `sort` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '排序，值越大越靠前',
