/*Table structure for table `yj_captcha_sms_log_tbl` */

DROP TABLE IF EXISTS `yj_captcha_sms_log_tbl`;

CREATE TABLE `yj_captcha_sms_log_tbl` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `phone` varchar(20) NOT NULL DEFAULT '' COMMENT '手机号码',
  `start_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '验证码生成时间',
  `scene` varchar(30) NOT NULL DEFAULT '' COMMENT '场景，如：注册、登录',
  `validate` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '是否验证，默认是没有验证',
  `sms_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '短信批号',
  `status` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '0：发送；1：重新发送',
  `code_num` varchar(20) NOT NULL DEFAULT '0' COMMENT '验证码',
  `sign_name` varchar(20) NOT NULL DEFAULT '' COMMENT '短信签名',
  `template` varchar(255) NOT NULL DEFAULT '' COMMENT '发送的短信模板',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=425 DEFAULT CHARSET=utf8;

