/*Table structure for table `yj_commission_allocate_log_tbl` */

DROP TABLE IF EXISTS `yj_commission_allocate_log_tbl`;

CREATE TABLE `yj_commission_allocate_log_tbl` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `order_id` int(10) unsigned NOT NULL COMMENT '订单ID',
  `goods_id` int(10) unsigned NOT NULL COMMENT '商品ID',
  `employee_id` int(10) unsigned NOT NULL COMMENT '员工ID',
  `type_id` tinyint(1) unsigned NOT NULL DEFAULT '1' COMMENT '分成类型，1 订单',
  `commission` decimal(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '员工分成',
  `operator_id` int(10) unsigned NOT NULL COMMENT '操作人ID',
  `create_time` int(10) unsigned NOT NULL COMMENT '创建时间',
  PRIMARY KEY (`id`),
  KEY `idx_order_id` (`order_id`) USING BTREE,
  KEY `idx_goods_id` (`goods_id`) USING BTREE,
  KEY `idx_employee_id` (`employee_id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=18 DEFAULT CHARSET=utf8 COMMENT='员工分成记录表';

