DROP TABLE IF EXISTS `yj_employee_commission_audit_tbl`;

CREATE TABLE `yj_employee_commission_audit_tbl` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `order_id` int(10) unsigned NOT NULL COMMENT '订单ID',
  `store_id` int(10) unsigned NOT NULL COMMENT '门店ID',
  `log_id` int(10) unsigned NOT NULL COMMENT '服务记录ID',
  `status` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '审核状态',
  `creator_id` int(10) unsigned NOT NULL COMMENT '创建人ID',
  `auditor_id` int(10) unsigned DEFAULT NULL COMMENT '审核人ID',
