/*Table structure for table `yj_employee_level_tbl` */

DROP TABLE IF EXISTS `yj_employee_level_tbl`;

CREATE TABLE `yj_employee_level_tbl` (
  `id` int(11) NOT NULL COMMENT '员工等级编号',
  `name` varchar(20) NOT NULL COMMENT '等级名称',
  `discount` decimal(3,2) NOT NULL DEFAULT '1.00' COMMENT '折扣',
  `base` decimal(4,2) NOT NULL DEFAULT '1.00' COMMENT '基数',
  KEY `id` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='员工等级表';

