/*Table structure for table `yj_employee_skill_tbl` */

DROP TABLE IF EXISTS `yj_employee_skill_tbl`;

CREATE TABLE `yj_employee_skill_tbl` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `employee_id` int(10) unsigned NOT NULL COMMENT '员工ID',
  `skill_id` int(10) unsigned NOT NULL COMMENT '技能ID',
  PRIMARY KEY (`id`),
  UNIQUE KEY `idx_employee_skill_id` (`employee_id`,`skill_id`) USING BTREE,
  KEY `idx_employee_id` (`employee_id`) USING BTREE,
  KEY `idx_skill_id` (`skill_id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=28 DEFAULT CHARSET=utf8 COMMENT='员工技能表';

