/*Table structure for table `yj_employee_statistic_tbl` */

DROP TABLE IF EXISTS `yj_employee_statistic_tbl`;

CREATE TABLE `yj_employee_statistic_tbl` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `e_id` int(10) unsigned NOT NULL COMMENT '员工id',
  `date_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '日期',
  `top_up` decimal(12,2) NOT NULL DEFAULT '0.00' COMMENT '充值总金额',
  `top_up_num` int(10) NOT NULL DEFAULT '0' COMMENT '充值总数',
  `top_up_extract` decimal(12,2) NOT NULL DEFAULT '0.00' COMMENT '充值业绩',
  `order` decimal(12,2) NOT NULL DEFAULT '0.00' COMMENT '订单总金额',
  `order_extract` decimal(12,2) NOT NULL DEFAULT '0.00' COMMENT '订单总业绩',
  `order_num` int(10) NOT NULL DEFAULT '0' COMMENT '订单数',
  `servier` decimal(12,2) NOT NULL DEFAULT '0.00' COMMENT '手工服务业绩',
  `servier_num` int(11) NOT NULL DEFAULT '0' COMMENT '手工服务总数',
  `year` int(11) NOT NULL COMMENT '年',
  `month` tinyint(4) NOT NULL COMMENT '月',
  `day` tinyint(4) NOT NULL COMMENT '日',
  `add_time` int(10) unsigned NOT NULL COMMENT '添加时间',
  PRIMARY KEY (`id`),
  UNIQUE KEY `e_id,date_time` (`e_id`,`date_time`)
) ENGINE=MyISAM AUTO_INCREMENT=3852 DEFAULT CHARSET=utf8;

