/*Table structure for table `yj_goods_tbl` */

DROP TABLE IF EXISTS `yj_goods_tbl`;

CREATE TABLE `yj_goods_tbl` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `title` varchar(255) NOT NULL DEFAULT '' COMMENT '商品名称',
  `subtitle` varchar(255) NOT NULL DEFAULT '' COMMENT '副标题',
  `title_py` varchar(255) DEFAULT NULL COMMENT '商品名称拼音',
  `type_id` tinyint(1) unsigned NOT NULL DEFAULT '1' COMMENT '商品类型，1 实物，2 服务',
  `barcode` varchar(50) NOT NULL DEFAULT '' COMMENT '条形码',
  `barcode_url` varchar(200) NOT NULL DEFAULT '' COMMENT '条形码url地址',
  `category_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '商品分类ID',
  `category_path` varchar(255) NOT NULL DEFAULT '' COMMENT '商品分类层级关系，父类放前面，子类放后面，用英文逗号分割，如：1,2,3',
  `spec` varchar(30) NOT NULL DEFAULT '' COMMENT '规格',
  `unit` varchar(30) NOT NULL DEFAULT '' COMMENT '单位',
  `price` decimal(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '商品价格',
  `market_price` decimal(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '市场价（实物类商品）',
  `experience_price` decimal(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '体验价（服务类商品）',
  `status` tinyint(1) unsigned NOT NULL DEFAULT '1' COMMENT '状态，0 下架，1 上架',
  `cover` varchar(255) NOT NULL DEFAULT '' COMMENT '封面图地址',
  `description` varchar(1000) NOT NULL DEFAULT '' COMMENT '商品描述/简介',
  `warning_num` int(10) NOT NULL DEFAULT '0' COMMENT '预警数量（实物类商品）',
  `class_hour` varchar(10) NOT NULL DEFAULT '0' COMMENT '课时（服务类商品）',
  `tips` varchar(300) NOT NULL DEFAULT '' COMMENT '提示（服务类商品）',
  `is_new` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '是否新品，0 否，1 是',
  `is_recommend` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '是否推荐，0 否，1 是',
  `commission` decimal(10,2) unsigned DEFAULT NULL COMMENT '销售提成',
  `op_user_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '添加人ID',
  `keywords` varchar(300) DEFAULT NULL COMMENT '商品关键词，多个以英文逗号分隔',
  `goods_code` varchar(30) DEFAULT NULL COMMENT '商品编码',
  `related_goods` varchar(300) DEFAULT NULL COMMENT '关联商品，多个以英文逗号分隔',
  `is_front` tinyint(1) unsigned NOT NULL DEFAULT '1' COMMENT '是否前台展示，0 否，1 是',
  `sale_volume` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '销量',
  `create_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '创建时间',
  `update_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '更新时间',
  PRIMARY KEY (`id`),
  UNIQUE KEY `goods_code` (`goods_code`),
  KEY `idx_type_id` (`type_id`) USING BTREE,
  KEY `idx_category_id` (`category_id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=183762 DEFAULT CHARSET=utf8 COMMENT='商品表';

