/*Table structure for table `yj_member_balance_tbl` */

DROP TABLE IF EXISTS `yj_member_balance_tbl`;

CREATE TABLE `yj_member_balance_tbl` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `m_id` int(11) NOT NULL COMMENT '会员编号',
  `m_using_amount` decimal(12,2) NOT NULL DEFAULT '0.00' COMMENT '使用金额',
  `object_id` tinyint(2) unsigned NOT NULL DEFAULT '1' COMMENT '1.订单',
  `type_id` tinyint(4) NOT NULL COMMENT '支付方式',
  `action_id` int(10) DEFAULT '0' COMMENT '使用项目id',
  `store_id` int(11) DEFAULT NULL COMMENT '充值分店ID',
  `op_id` int(11) NOT NULL COMMENT '操作人ID',
  `remark` varchar(255) DEFAULT NULL COMMENT '备注',
  `add_time` int(11) NOT NULL COMMENT '充值时间',
  PRIMARY KEY (`id`),
  KEY `m_id` (`m_id`),
  KEY `add_time` (`add_time`)
) ENGINE=InnoDB AUTO_INCREMENT=249 DEFAULT CHARSET=utf8 COMMENT='会员余额记录表';

