/*Table structure for table `yj_member_buy_goods_tbl` */

DROP TABLE IF EXISTS `yj_member_buy_goods_tbl`;

CREATE TABLE `yj_member_buy_goods_tbl` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `order_id` int(10) unsigned NOT NULL COMMENT '订单ID',
  `order_sn` varchar(64) NOT NULL COMMENT '订单号',
  `status` tinyint(2) unsigned NOT NULL DEFAULT '1' COMMENT '服务订单状态 1正常 2删除',
  `store_id` int(10) unsigned NOT NULL COMMENT '门店ID',
  `goods_id` int(10) unsigned NOT NULL COMMENT '商品ID',
  `goods_title` varchar(255) NOT NULL COMMENT '商品名称',
  `goods_type` tinyint(1) unsigned NOT NULL COMMENT '商品类型，1 实物，2 服务',
  `user_id` int(10) unsigned NOT NULL COMMENT '用户ID',
  `user_nickname` varchar(100) NOT NULL COMMENT '用户昵称',
