/*Table structure for table `yj_member_level_tbl` */

DROP TABLE IF EXISTS `yj_member_level_tbl`;

CREATE TABLE `yj_member_level_tbl` (
  `id` int(11) NOT NULL COMMENT '会员等级编号',
  `name` varchar(20) NOT NULL COMMENT '会员等级名称',
  `discount` decimal(3,2) NOT NULL COMMENT '会员折扣',
  `level_amount` decimal(8,2) NOT NULL COMMENT '达到等级所需金额',
  KEY `id` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='会员等级表';

/*Data for the table `yj_member_level_tbl` */

insert  into `yj_member_level_tbl`(`id`,`name`,`discount`,`level_amount`) values (1,'准会员','1.00','1000.00'),(2,'普通会员','1.00','2000.00'),(3,'白银会员','1.00','5000.00'),(4,'黄金会员','1.00','6000.00'),(5,'铂金会员','1.00','8000.00'),(6,'钻石会员','1.00','10000.00');

/*Table structure for table `yj_member_recharge_tbl` */

DROP TABLE IF EXISTS `yj_member_recharge_tbl`;

CREATE TABLE `yj_member_recharge_tbl` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `m_id` int(11) NOT NULL COMMENT '会员编号',
  `m_amount` decimal(12,2) NOT NULL DEFAULT '0.00' COMMENT '充值金额',
  `m_given_amount` decimal(12,2) DEFAULT '0.00' COMMENT '赠送金额',
  `m_using_amount` decimal(12,2) DEFAULT '0.00' COMMENT '使用金额',
  `type_id` tinyint(4) NOT NULL COMMENT '支付方式',
  `store_id` int(11) DEFAULT '1' COMMENT '充值分店ID',
  `reward_e_ids` varchar(200) DEFAULT NULL COMMENT '提成人员ID',
  `op_id` int(11) NOT NULL COMMENT '操作人ID',
  `remark` varchar(255) DEFAULT NULL COMMENT '备注',
  `extract` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '充值提成',
  `flow_number` varchar(120) DEFAULT NULL COMMENT '流水号',
  `add_time` int(11) NOT NULL COMMENT '充值时间',
  PRIMARY KEY (`id`),
  KEY `m_id` (`m_id`),
  KEY `add_time` (`add_time`),
  KEY `reward_e_ids` (`reward_e_ids`)
) ENGINE=InnoDB AUTO_INCREMENT=90 DEFAULT CHARSET=utf8 COMMENT='会员充值记录表';

