/*Table structure for table `yj_member_tbl_test` */

DROP TABLE IF EXISTS `yj_member_tbl_test`;

CREATE TABLE `yj_member_tbl_test` (
  `m_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '会员编号',
  `m_nickname` varchar(20) NOT NULL COMMENT '会员昵称',
  `m_mobile` varchar(20) NOT NULL COMMENT '会员手机',
  `m_pwd` varchar(255) NOT NULL DEFAULT '' COMMENT '会员密码',
  `m_head_img` varchar(255) DEFAULT NULL COMMENT '会员头像',
  `m_birthday` date NOT NULL COMMENT '会员生日',
  `m_sex` tinyint(2) DEFAULT '1' COMMENT '会员性别 1男 2女',
  `province` int(11) DEFAULT NULL COMMENT '省',
  `city` int(11) DEFAULT NULL COMMENT '市',
  `county` int(11) NOT NULL DEFAULT '0' COMMENT '区',
  `m_address` varchar(50) DEFAULT '' COMMENT '会员详细住址',
  `m_point` int(11) NOT NULL DEFAULT '0' COMMENT '会员积分',
  `all_amount` decimal(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '会员总金额',
  `m_amount` decimal(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '会员充值金额',
  `m_given_amount` decimal(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '会员赠送金额',
  `m_using_amount` decimal(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '使用余额支付总金额',
  `m_consumption_amount` decimal(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '总消费金额',
  `e_mail` char(32) DEFAULT '' COMMENT '会员邮箱',
  `salt` char(6) DEFAULT NULL COMMENT '盐',
  `crm_customer_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT 'crm客户id',
  `crm_emp_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT 'crm业务员id',
  `level_id` tinyint(4) NOT NULL DEFAULT '1' COMMENT '会员等级,对应会员等级表',
  `store_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '分店ID',
  `status` tinyint(4) NOT NULL DEFAULT '1' COMMENT '会员状态 1有效 2无效',
  `q_code` varchar(50) DEFAULT NULL COMMENT '会员二维码',
  `q_code_img` varchar(255) DEFAULT NULL COMMENT '会员二维码地址',
  `remark` varchar(255) DEFAULT '' COMMENT '备注',
  `op_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '会员归属的管理员id',
  `ref_id` int(11) NOT NULL DEFAULT '0' COMMENT '推荐人ID',
  `first_order` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '第一次购买',
  `second_order` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '第二次购买',
  `last_order` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '最后一次购买',
  `add_time` int(11) NOT NULL COMMENT '添加时间',
  PRIMARY KEY (`m_id`),
  UNIQUE KEY `m_mobile` (`m_mobile`),
  UNIQUE KEY `q_code` (`q_code`),
  KEY `add_time` (`add_time`)
