/*Table structure for table `yj_member_weixin_tbl` */

DROP TABLE IF EXISTS `yj_member_weixin_tbl`;

CREATE TABLE `yj_member_weixin_tbl` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `user_id` int(10) unsigned DEFAULT NULL COMMENT '用户ID',
  `nickname` varchar(255) DEFAULT NULL COMMENT '用户昵称',
  `avatar` varchar(255) DEFAULT NULL COMMENT '用户头像地址',
  `gender` tinyint(1) unsigned DEFAULT NULL COMMENT '性别，0 未知，1 男，2 女',
  `country` varchar(60) DEFAULT NULL COMMENT '国家',
  `province` varchar(60) DEFAULT NULL COMMENT '省份',
  `city` varchar(60) DEFAULT NULL COMMENT '城市',
  `language` varchar(255) DEFAULT NULL COMMENT '用户的语言',
  `openid` varchar(60) NOT NULL,
  `unionid` varchar(60) DEFAULT NULL,
  `status` tinyint(1) unsigned NOT NULL DEFAULT '1' COMMENT '状态，1 关注，2 取消关注',
  `create_time` int(10) unsigned NOT NULL COMMENT '添加时间',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE KEY `idx_user_id` (`user_id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=124 DEFAULT CHARSET=utf8 COMMENT='微信用户表';

