/*Table structure for table `yj_order_goods_tbl` */

DROP TABLE IF EXISTS `yj_order_goods_tbl`;

CREATE TABLE `yj_order_goods_tbl` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `order_id` int(10) unsigned NOT NULL COMMENT '关联的订单id',
  `goods_id` int(10) unsigned NOT NULL COMMENT '商品id',
  `goods_title` varchar(100) NOT NULL DEFAULT '' COMMENT '商品名称',
  `prices` decimal(10,2) NOT NULL COMMENT '商品价格',
  `num` int(11) NOT NULL COMMENT '商品数量',
  `spec_list` text COMMENT '服务商品的话有服务项',
  `reward_type` tinyint(3) unsigned NOT NULL DEFAULT '1' COMMENT '奖励类型,1固定提成或2比例提成',
  `reward_ratio` decimal(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '提成比例或数额',
  `add_time` int(10) unsigned NOT NULL COMMENT '添加时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=394 DEFAULT CHARSET=utf8;

