/*Table structure for table `yj_order_refund_audit_tbl` */

DROP TABLE IF EXISTS `yj_order_refund_audit_tbl`;

CREATE TABLE `yj_order_refund_audit_tbl` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `order_id` int(10) unsigned NOT NULL COMMENT '订单ID',
  `order_sn` varchar(32) NOT NULL DEFAULT '' COMMENT '订单号',
  `buyer_id` int(10) unsigned NOT NULL COMMENT '购买人ID',
  `applicant_id` int(10) unsigned NOT NULL COMMENT '申请人ID',
  `auditor_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '审核人ID',
  `refund_amount` decimal(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '退款金额',
  `order_amount` decimal(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '订单金额',
  `postage` decimal(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT ' 邮费',
  `remark` varchar(500) NOT NULL DEFAULT '' COMMENT '申请备注',
  `status` tinyint(1) unsigned NOT NULL COMMENT '申请状态，1 待审核，2 通过，3 拒绝',
  `goods_ids` varchar(500) NOT NULL DEFAULT '' COMMENT '退款商品ID集合，多个以英文逗号分隔',
  `order_goods_ids` varchar(500) NOT NULL DEFAULT '' COMMENT '订单商品表中，退款对应的商品记录ID',
  `apply_time` int(10) unsigned NOT NULL COMMENT '申请时间',
  `audit_time` int(10) NOT NULL DEFAULT '0' COMMENT '审核时间',
  PRIMARY KEY (`id`),
  KEY `idx_order_id` (`order_id`) USING BTREE,
  KEY `idx_buyer_id` (`buyer_id`) USING BTREE,
  KEY `idx_applicant_id` (`applicant_id`) USING BTREE,
  KEY `idx_auditor_id` (`auditor_id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=25 DEFAULT CHARSET=utf8 COMMENT='订单退款申请表';

