/*Table structure for table `yj_order_tbl` */

DROP TABLE IF EXISTS `yj_order_tbl`;

CREATE TABLE `yj_order_tbl` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `order_sn` varchar(64) NOT NULL COMMENT '订单号',
  `store_id` int(10) unsigned NOT NULL DEFAULT '1' COMMENT '关联的门店id',
  `order_type` tinyint(4) NOT NULL DEFAULT '1' COMMENT '订单类型,配置项,1:线下单,2:线上单',
  `order_referer` tinyint(3) unsigned NOT NULL DEFAULT '1' COMMENT '订单来源,配置项,1:线下店',
  `buyer_userid` int(10) unsigned NOT NULL COMMENT '购买者id',
  `original_amount` decimal(10,2) unsigned NOT NULL COMMENT '订单原始金额',
  `discount_amount` decimal(10,2) unsigned NOT NULL COMMENT '优惠金额',
  `actual_amount` decimal(10,2) unsigned NOT NULL COMMENT '订单实付金额',
  `deposit_rate` tinyint(3) unsigned NOT NULL DEFAULT '100' COMMENT '折扣率',
  `payment_mode` tinyint(3) unsigned NOT NULL DEFAULT '1' COMMENT '订单支付类型,配置项,1:现金,2:微信,3:支付宝,4:银联,5:信用卡',
  `pay_status` tinyint(3) unsigned NOT NULL DEFAULT '2' COMMENT '支付状态,1:已支付,2未支付',
  `order_status` int(10) unsigned NOT NULL DEFAULT '10' COMMENT '订单状态，配置文件order_config的字段order_status',
  `refund_status` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '退款状态，配置文件order_config的字段refund_status',
  `reward_userids` varchar(100) NOT NULL DEFAULT '' COMMENT '能提成的业务员',
  `user_id` int(10) unsigned NOT NULL COMMENT '业务员用户id',
  `remark` text COMMENT '订单备注',
  `add_time` int(10) unsigned NOT NULL COMMENT '创建时间',
  `update_time` int(10) unsigned NOT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`),
  KEY `buyer_userid` (`buyer_userid`),
  KEY `user_id` (`user_id`),
  KEY `pay_status` (`pay_status`),
  KEY `order_status` (`order_status`)
) ENGINE=InnoDB AUTO_INCREMENT=184019 DEFAULT CHARSET=utf8;

