/*Table structure for table `yj_store_statistic_tbl` */

DROP TABLE IF EXISTS `yj_store_statistic_tbl`;

CREATE TABLE `yj_store_statistic_tbl` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `store_id` int(10) unsigned NOT NULL COMMENT '店铺id',
  `date_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '年月日',
  `top_up` decimal(12,2) NOT NULL DEFAULT '0.00' COMMENT '会员充值',
  `top_up_giving` decimal(12,2) NOT NULL DEFAULT '0.00' COMMENT '会员充值赠送',
  `top_up_num` int(10) DEFAULT '0' COMMENT '充值单数',
  `order` int(10) NOT NULL DEFAULT '0' COMMENT '店铺订单数',
  `order_prices` decimal(12,2) NOT NULL DEFAULT '0.00' COMMENT '订单金额',
  `servier` decimal(12,2) NOT NULL DEFAULT '0.00' COMMENT '服务手工费',
  `servier_num` int(10) NOT NULL DEFAULT '0' COMMENT '服务手工单数',
  `year` int(11) NOT NULL COMMENT '年',
  `month` tinyint(4) DEFAULT NULL COMMENT '月',
  `day` tinyint(4) DEFAULT NULL COMMENT '日',
  `add_time` int(10) unsigned NOT NULL COMMENT '添加时间',
  PRIMARY KEY (`id`),
  UNIQUE KEY `date_time` (`date_time`,`store_id`)
) ENGINE=MyISAM AUTO_INCREMENT=532 DEFAULT CHARSET=utf8;

