/*Table structure for table `yj_store_tbl` */

DROP TABLE IF EXISTS `yj_store_tbl`;

CREATE TABLE `yj_store_tbl` (
  `s_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '分店ID',
  `s_name` varchar(100) NOT NULL COMMENT '店名',
  `s_img` varchar(255) NOT NULL COMMENT '封面',
  `s_phone` char(20) NOT NULL COMMENT '联系方式',
  `status` tinyint(2) NOT NULL DEFAULT '1' COMMENT '状态 1有效 2无效',
  `shopowner` varchar(20) DEFAULT NULL COMMENT '店长',
  `zip_code` int(11) DEFAULT NULL COMMENT '邮编',
  `location_id` int(11) DEFAULT NULL COMMENT '地区ID',
  `address` varchar(255) DEFAULT NULL COMMENT '具体地址',
  `introduction` text COMMENT '简介',
  `base` decimal(4,2) DEFAULT '1.00' COMMENT '基数',
  `parent_id` varchar(255) DEFAULT '0' COMMENT '父级',
  `children_id` varchar(255) DEFAULT NULL COMMENT '下级',
  `emp_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '公司销售介绍人id',
  `emp_detail` varchar(50) DEFAULT NULL COMMENT '公司销售介绍人code/name',
  `add_time` int(11) NOT NULL COMMENT '添加时间',
  PRIMARY KEY (`s_id`)
