/*Table structure for table `yj_warehouse_goods_stock_tbl` */

DROP TABLE IF EXISTS `yj_warehouse_goods_stock_tbl`;

CREATE TABLE `yj_warehouse_goods_stock_tbl` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `goods_id` int(10) unsigned NOT NULL COMMENT '商品id',
  `type_id` tinyint(4) DEFAULT '1' COMMENT '入库类型1入库 2出库 3冻结入 4冻结出 5调仓入 6调仓出 100损耗',
  `warehouse_id` int(10) unsigned NOT NULL COMMENT '仓库id/店铺id',
  `supplier_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '供应商id',
  `in_prices` decimal(12,2) NOT NULL DEFAULT '0.00' COMMENT '入仓价',
  `out_prices` decimal(12,2) NOT NULL DEFAULT '0.00' COMMENT '出仓价',
  `out_type` tinyint(3) unsigned NOT NULL DEFAULT '2' COMMENT '出处的类型 1订单 2工单',
  `out_id` int(11) NOT NULL DEFAULT '0' COMMENT '出处id',
  `num` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '数量',
  `remark` varchar(250) NOT NULL DEFAULT '' COMMENT '备注',
  `op_img` varchar(255) NOT NULL DEFAULT '' COMMENT '出仓入仓留存图',
  `add_time` int(10) unsigned NOT NULL COMMENT '时间',
  `add_user` int(10) unsigned NOT NULL COMMENT '操作人',
  PRIMARY KEY (`id`),
  KEY `goods_id` (`goods_id`,`type_id`),
  KEY `goods_id_2` (`goods_id`,`type_id`,`warehouse_id`)
) ENGINE=InnoDB AUTO_INCREMENT=320 DEFAULT CHARSET=utf8 COMMENT='进销记录';

