DROP TABLE IF EXISTS `yj_warehouse_goods_tbl`;

CREATE TABLE `yj_warehouse_goods_tbl` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `goods_id` int(10) unsigned NOT NULL COMMENT '商品id',
  `warehouse_id` int(10) unsigned NOT NULL COMMENT '仓库id',
  `price` decimal(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '入仓价格',
  `total` int(10) NOT NULL DEFAULT '0' COMMENT '总库存',
  `available_num` int(10) NOT NULL DEFAULT '0' COMMENT '可用库存',
  `freeze_num` int(10) NOT NULL DEFAULT '0' COMMENT '待发货库存',
  `add_time` int(10) unsigned NOT NULL,
  `update_time` int(10) unsigned NOT NULL,
  PRIMARY KEY (`id`),
  KEY `goods_id` (`goods_id`),
  KEY `warehouse_id` (`warehouse_id`)
) ENGINE=InnoDB AUTO_INCREMENT=86 DEFAULT CHARSET=utf8 COMMENT='仓库对应商品库存数';

